import { GetUserTokenService, GetUserTokenUseCase } from '../usecase'

class GetUserToken implements GetUserTokenUseCase {
  private readonly service: GetUserTokenService

  constructor(service: GetUserTokenService) {
    this.service = service
  }

  getUserToken(): Promise<string> {
    return this.service.getUserToken()
  }
}

export { GetUserToken }
